using System.Collections;
using System.Collections.Generic;
using System.Linq;
using Inworld.Audio;
using Inworld.Packet;
using NUnit.Framework;
using UnityEngine;
using UnityEngine.TestTools;

namespace Inworld.Test
{
	// YAN: This is the framework for unit test for the runtime. 
	//		For all the test cases, please visit SyncTests / AsyncTests
    public abstract class InworldRuntimeTest
    {
		protected const string k_TestScene = "workspaces/unitytest/scenes/testing_space";
		protected const string k_TestSceneVoice = "workspaces/unitytest/scenes/testing_voice";
		protected const string k_TestQuin = "workspaces/unitytest/characters/testing_quinn";
		protected const string k_TestVoiceGuy = "workspaces/unitytest/characters/voice_guy";
		protected const string k_TestSceneName = "Testing Space";
		protected const string k_TestQuinName = "Testing Quinn";
		protected const string k_TestVoiceName = "Voice guy";
		protected const string k_AudioChunkBase64 =
			"";
		protected const string k_VerbatimResponse = "Hey there, I'm doing well.";
		protected const string k_PlayerName = "Player";

		protected const string k_RepeatableGoal = "inworld.goal.activated.test_repeatable";
		protected const string k_UnrepeatableGoal = "inworld.goal.activated.test_unrepeatable";
		protected const string k_TriggerGoal = "inworld.goal.activated.test_trigger";
		protected const string k_TriggerResponse = "You successfully triggered that.";
		
		protected InworldConnectionStatus m_CurrentStatus;
		protected List<InworldPacket> m_Conversation;
		protected string m_CurrentInworldScene;
		
		protected virtual void OnClientStatusChanged(InworldConnectionStatus status)
		{
			m_CurrentStatus = status;
		}
		protected virtual void OnPacketReceived(InworldPacket packet)
		{
			if (packet.Source == SourceType.AGENT)
				m_Conversation.Add(packet);
			if (packet is ControlPacket controlPacket &&
			    controlPacket.control is CurrentSceneStatusEvent currentSceneStatusEvent)
			{
				m_CurrentInworldScene = currentSceneStatusEvent.currentSceneStatus.sceneName;
			}
		}

		protected abstract IEnumerator InitTest();
		protected abstract IEnumerator FinishTest();


		protected virtual IEnumerator StatusCheck(float timeout, InworldConnectionStatus condition)
		{
			while (timeout > 0)
			{
				if (m_CurrentStatus == condition)
				{
					yield break;
				}
				timeout -= Time.fixedDeltaTime;
				yield return new WaitForFixedUpdate();
			}
			Assert.AreEqual(condition, m_CurrentStatus);
		}
		protected virtual IEnumerator LiveSessionCheck(float timeout)
		{
			while (timeout > 0)
			{
				if (InworldController.Client.LiveSessionData.Count > 0)
				{
					yield break;
				}
				timeout -= Time.fixedDeltaTime;
				yield return new WaitForFixedUpdate();
			}
			Assert.Greater(InworldController.Client.LiveSessionData.Count, 0);
		}
		protected virtual IEnumerator ConversationCheck(float timeout, bool isExpected = true)
		{
			while (timeout > 0)
			{
				if (m_Conversation.Any(p => p is ControlPacket))
				{
					yield break;
				}
				timeout -= Time.fixedDeltaTime;
				yield return new WaitForFixedUpdate();
			}
			if (isExpected)
				Assert.Greater(m_Conversation.Count, 0);
			else
				Assert.IsEmpty(m_Conversation);
		}
		[UnitySetUp]
		public virtual IEnumerator InitEnv()
		{
			InworldAI.User.Name = k_PlayerName;
			InworldController ctrl = Object.Instantiate(InworldAI.ControllerPrefab);
			Assert.NotNull(InworldController.Instance);
#if !UNITY_WEBGL
			Assert.IsTrue(InworldController.Audio.TryDeleteModule<AudioCaptureModule>());
			AudioCaptureModule micCtrl = Object.FindFirstObjectByType<AudioCaptureModule>();
			if (micCtrl != null)
				Object.Destroy(micCtrl);
#endif
			m_Conversation = new List<InworldPacket>();
			InworldController.Client.OnStatusChanged += OnClientStatusChanged;
			InworldController.Client.OnPacketReceived += OnPacketReceived;
			yield return InitTest();
			
		}
		[UnityTearDown]
		public virtual IEnumerator CleanupEnv()
		{
			yield return FinishTest();
			m_Conversation.Clear();
			InworldController.Instance.Disconnect();
			Assert.NotNull(InworldController.Instance);
			InworldController.Client.OnStatusChanged -= OnClientStatusChanged;
			InworldController.Client.OnPacketReceived -= OnPacketReceived;
			Object.DestroyImmediate(InworldController.Instance.gameObject);
			Assert.IsNull(InworldController.Instance);
			
		}


    }
}